public void testShakyPrefix(){
  JakartaRegexpCapabilities cap = new JakartaRegexpCapabilities();
  cap.compile("(ab|ac)");
  assertTrue(cap.match("ab"));
  assertTrue(cap.match("ac"));
  // why is it not a???
  assertNull(cap.prefix());
}

